Coffee shop journal, “Swamp Rabbit Cafe”, post 2 of 2, continued from yesterday… ☕️✨

This gorgeous cafe/farmers market with the hysterical name is actually a 4⭐️ for me, and I’m guessing for most people it would be a 5⭐️. Not only does it serve great coffee, but artisan sandwiches, wine, etc., and it also offers a fully stocked market with local health foods, flowers, stationery, clothing, and self care products.  Using @alwayslovelyco ’s “Take Care” stickers and a cafe sticker sheet from @paperlyowl fit really perfectly the theme of this fun place.  Again, still confused with the “Swamp Rabbit” name, but it’s a Greenville thing haha. 🐰

